import React from "react";
import { Chart } from "react-google-charts";

export const data = [
  ["Task", "Hours per Day"],
  ["Work", 11],
  ["Eat", 2],
  ["Commute", 2],
  ["Watch TV", 2],
  ["Sleep", 7]
];

export const options = {
  title: "My Daily Activities",
  pieHole: 0.4,
  is3D: false,
};

export function Graphic() {
  return (
    <Chart
      chartType="PieChart"
      width="50%"
      height="400px"
      data={data}
      options={options}
    />
  );
}
